import React, { Component } from 'react'
import styled from 'styled-components'

export class Serp extends Component {
    render() {

        const Button = styled.button`
            background: transparent;
            border-radius: 3px;
            border: 2px solid palevioletred;
            color: palevioletred;
            margin: 0 1em;
            padding: 0.25em 1em;
            `
        return (
            <div>
                <Button />
            </div>
        )
    }
}

export default Serp
